import styles from "../assets/styles/homepage.css"
import useSWR from 'swr';

function fetcher(url){
    return fetch(url).then(r =>r.json());
}

const Index = () => {
    const { data, error } = useSWR("/api/getProfileRoles", fetcher);

    let role = data;
    console.log(role);
    if(!data) role = "No Data";
    if(error) role = "No Information";

    return (
            <main className="main">
                <div>
                    <h1>Raghav Sharma</h1>
                    <div className="role">I am {role}</div>
                </div>
            </main>);
}

export default Index;
